import Nickname from "./Nickname";

const MainPage = ({ nickname, setNickname }) => {
  return (
    <div className="container">
      <h1>Movie Poll</h1>
      <div className="grid ">
        <Nickname
          onPickNickname={(nickname) => {
            setNickname(nickname);
          }}
          nickname={nickname}
        />
      </div>
    </div>
  );
};

export default MainPage;
